function createData(jobid, status, warning, name, user, partition, nodes, cpus, timeleft, memory, reason, command, start_time) {
  return {
    id: jobid,
    status,
    warning,
    name,
    user,
    partition,
    nodes,
    cpus,
    timeleft,
    memory,
    reason,
    command,
    start_time,
  };
}

function createData_CompletedJob(jobid, name, state, user, partition, nodes, cpus, submittime, endtime, starttime, memory, elapsed_time, workdir, submit, begin) {
  return {
    id: jobid,
    name,
    State: state,
    User: user,
    Partition: partition,
    Nodes: nodes,
    CPUS: cpus,
    submittime,
    endtime,
    starttime,
    Memory: memory,
    Elapsed: elapsed_time,
    workdir: workdir,
    submit: submit,
    Begin: begin,
  };
}

function createRadarData(partitionData, normalize = false, useLog = false) {
  const defaultPartitions = {
    standard: 0,
    build: 0,
    viz: 0,
    gpu: 0,
    spgpu: 0,
    spgpu2: 0,
    gpu_mig40: 0,
    debug: 0,
    largemem: 0,
  };

  const mergedData = { ...defaultPartitions, ...partitionData };
  const labels = Object.keys(mergedData);
  let data = Object.values(mergedData);

  if (useLog) {
    data = data.map(value => value > 0 ? Math.log(value) : 0);
  } else if (normalize) {
    const max = Math.max(...data);
    data = data.map(value => value / max);
  }

  return {
    labels,
    datasets: [
      {
        label: 'Partitions',
        backgroundColor: 'rgba(129,203,159,0.2)',
        borderColor: 'rgba(129,203,159,1)',
        pointBackgroundColor: 'rgba(129,203,159,1)',
        pointBorderColor: '#fff',
        pointHoverBackgroundColor: '#fff',
        pointHoverBorderColor: 'rgba(179,181,198,1)',
        data,
      },
    ],
  };
}

